        title: Here men from the planet Earth first set foot upon the Moon
        img: 3img
        body: Here men from the planet Earth first set foot upon the Moon. July 1969 AD. We came in peace for all mankind. Science has not yet mastered prophecy. We predict too much for the next year and yet far too little for the next 10. As I stand out here in the wonders of the unknown at Hadley, I sort of realize there’s a fundamental truth to our nature, Man must explore . . . and this is exploration at its greatest. NASA is not about the ‘Adventure of Human Space Exploration’…We won’t be doing it just to get out there in space – we’ll be doing it because the things we learn out there will be making life better for a lot of people who won’t be able to go. We are all connected; To each other, biologically. To the earth, chemically. To the rest of the universe atomically.
