        title: Buy why, some say, the moon?
        img: 5img
        body: Buy why, some say, the moon? Why choose this as our goal? And they may as well ask why climb the highest mountain? Here men from the planet Earth first set foot upon the Moon. July 1969 AD. We came in peace for all mankind. What was most significant about the lunar voyage was not that man set foot on the Moon but that they set eye on the earth. Never in all their history have men been able truly to conceive of the world as one a single sphere, a globe, having the qualities of a globe, a round earth in which all the directions eventually meet, in which there is no center because every point, or none, is center — an equal earth which all men occupy as equals. The airmans earth, if free men make it, will be truly round a globe in practice, not in theory. We want to explore. We’re curious people. Look back over history, people have put their lives at stake to go out and explore … We believe in what we’re doing. Now it’s time to go.
